static int pca_network_test()
{
	clock_counter t;
	t.begin();
	const int dim = 128;
	//typedef apex_network<dim, 32>								network_type;
	//typedef gha_network<dim, 32>								network_type;
	typedef ghia_network<dim, 8>								network_type;
	typedef network_type::sample_type							sample_type;
	typedef network_type::samples_type							samples_type;
	typedef pca_network_validator<network_type>					validator_type;
	typedef kfold_cross_validator<network_type, validator_type>	cross_validator_type;
	network_type												net;
	validator_type												validator;
	cross_validator_type										cross_validator;
	

	sample_type		sp;
	samples_type	sps;

	int i, j;
	for (i = 0; i < int(EXTL_ELEMENT_NUM(pca_network_test_data) / dim); ++i)
	{
		for (j = 0; j < dim; ++j)
			sp.set_finput(j, pca_network_test_data[i * dim + j]);
		sps.push_back(sp);
	}

	net.train(sps, 100);
	sample_type ret = net.run(sp);

	printf("input:");for (i = 0; i < (int)sp.input_size(); ++i) printf(" %0.2f", sp.get_finput(i));printf("\n");
	printf("output:");for (i = 0; i < (int)ret.output_size(); ++i) printf(" %0.2f", ret.get_foutput(i));printf("\n");
	printf("approximate:");for (i = 0; i < (int)ret.input_size(); ++i) printf(" %0.2f", ret.get_finput(i));printf("\n");
	printf("approximate 0-1:");for (i = 0; i < (int)ret.input_size(); ++i) printf(" %d", xtl_round45(ret.get_finput(i)));printf("\n");
	
	printf("\n");
	for (i = 0; i < (int)sp.output_size(); ++i) 
	{
		printf("vector(%d) dot(%f):", i, net.vector(i).dot());
		for (j = 0; j < (int)sp.input_size(); ++j) printf(" %0.2f", net.vector(i)[j]);
		printf("\n");

		/*if (i > 0)
		{
			printf("active(%d) norm_i(%f):", i, net.active(i).norm_i());
			for (j = 0; j < i; ++j) printf(" %0.2f", net.active(i)[j]);
			printf("\n\n");
		}*/
	}

	validator.validate(net, sps);
	printf("basic mse:%f\n", validator.mse());

	cross_validator.validate(net, sps);
	printf("cross mse:%f\n", cross_validator.mse());

	t.end();
	printf("time: %d\n", t.ms());

	return 0;
}
int pca_network_test_ret = pca_network_test();

